import React from 'react';
import NodeRenderer from './NodeRenderer';

function DocumentRenderer({ data }) {
    if (!data || data.length === 0) {
        console.log('DocumentRenderer: No data or empty data.');
        return <div>No data to render.</div>;
    }

    console.log('DocumentRenderer data:', data);

    return (
        <div>
            {data.map((node, index) => {
                console.log('Rendering block:', node);
                return <NodeRenderer key={index} node={node}/>
            })}
        </div>
    );
}

export default DocumentRenderer;
